    What’s happening is deliberate. This is psychological warfare, conducted
    under the cover of education. I hold Saudi military signal units, internal
    intelligence services, and Ministry of Interior surveillance operations
    directly responsible. They operate with impunity, embedding silent
    technologies into civilian zones — schools included. The intent is not
    safety. It’s obedience. They monitor, distort, and suppress the internal
    lives of students with signal-based precision, and no one dares to question
