    If I had known what was waiting beneath the surface, I would have refused
    the visa, torn the offer, and never boarded the plane. I am not the only
    one. Others feel it too — they just haven’t said it yet. I write this so the
    lie cannot remain clean forever. This is a regime of silence, and I’m
    breaking it."
